script: |
  super -f text -I q6573.spq | sort > q6573.out

inputs:
  - name: q6573.spq
    data: |
      SELECT DISTINCT - col2 FROM tab0 (FORMAT parquet) WHERE NOT col1 * col2 IN ( - col0 / - col0 + + col1 * col1 - - col0 * col2 );
  - name: tab0

outputs:
  - name: q6573.out
    data: |
      -1
      -33
      -82
